pragma solidity ^0.8.4;
import './Famepay.sol';
import './Bounty/FamepayBounty.sol';
import '@openzeppelin/contracts/utils/math/SafeMath.sol';
import '@openzeppelin/contracts/security/ReentrancyGuard.sol';
import './FamepayAccessControl.sol';

// SPDX-License-Identifier: PRIVATE

contract FamepayFactory is ReentrancyGuard {
    using SafeMath for uint256;

    AccessControl accessControl;

    uint256 public campaignPointer;

    address payable private platform;

    bytes32 public constant ADMIN_ROLE = keccak256('ADMIN');

    mapping(uint256 => address) public famepayCampaigns;

    event NewFamepayCampaignCreated(
        address indexed _influencer,
        address indexed _business,
        address indexed _campaignAddress,
        uint256 _campaignId,
        uint256 _startDate,
        uint256 _deadline,
        uint256 _simplePostDuration,
        uint256 _jackpotPayment,
        uint256 _incrementalPayment,
        uint256 _jackpotTargetAmount,
        uint256 _incrementalTargetAmount,
        uint256 _potentialPayoutAmount,
        bytes4 _objective
    );

    event NewMultiBountyCreated(
        address indexed _business,
        address indexed _bountyAddress,
        uint256 _startDate,
        uint256 _deadline,
        uint256 _simplePostDuration,
        uint256 _maxJackpotReward,
        uint256 _jackpotTargetAmount,
        uint256 _maxWinners,
        uint256 _bountyId,
        uint256 _escrowedAmount,
        bytes32 _bountyType,
        bytes4 _objective
    );

    constructor(AccessControl _accessControl) {
        platform = payable(msg.sender);
        accessControl = _accessControl;
    }

    /**
     * @dev create new one-to-one campaign
     * @param _influencer participating influencer
     * @param _business participating business
     * @param _startDate start timestamp of campaign
     * @param _deadline completion timestamp of campaign
     * @param _simplePostDuration duration which post must be up
     * @param _jackpotPayment reward for achieving jackpot objective
     * @param _incrementalPayment reward for achieving incremental objective
     * @param _jackpotTargetAmount minimum target metric to achieve jackpot objective
     * @param _incrementalTargetAmount minimum target metric to achieve incremental objective
     * @param _potentialPayoutAmount total eth staked in the contract to be earned
     * @param _objective objective type
     */
    function newFamepayCampaign(
        address payable _influencer,
        address payable _business,
        uint256 _startDate,
        uint256 _deadline,
        uint256 _simplePostDuration,
        uint256 _jackpotPayment, //$1000 if we hit 1,000,000 views
        uint256 _incrementalPayment, //$50 for every 50,000 views    //0 for simple post
        uint256 _jackpotTargetAmount,
        uint256 _incrementalTargetAmount, //1 for simple post
        uint256 _potentialPayoutAmount, //total in contract $2000 //TODO can probably be taken out for msg.value
        bytes4 _objective
    ) external payable {
        if (keccak256(abi.encodePacked(_objective)) != keccak256(abi.encodePacked('post'))) {
            //ex. 7 payments till jackpot
            uint256 incrementalPaymentsTillJackpotAmount = _jackpotTargetAmount / _incrementalTargetAmount;
            //ex. 7 payments is total $400
            uint256 incrementalPaymentsTillJackpotValue = _incrementalPayment * incrementalPaymentsTillJackpotAmount;
            //payout must be bigger than totalIncremental reward + jackpot reward
            require(
                _potentialPayoutAmount > _jackpotPayment + incrementalPaymentsTillJackpotValue,
                'newFamepayCampaign(): Potential payout is invalid'
            );
            //all the logic on one line
            //TODO --> failing in tests
            // require(
            //     _potentialPayoutAmount >
            //         _jackpotPayment.add(_incrementalPayment.mul(_jackpotTargetAmount.div(_incrementalTargetAmount))),
            //     'newFamepayCampaign(): Potential payout is invalid one line logic'
            // );
        } else {
            require(_simplePostDuration >= 43200, 'newFamepayCampaign(): post must be at least 12 hours');
            require(_incrementalPayment == 0, 'newFamepayCampaign(): no incremental payment for simple post');
            require(_incrementalTargetAmount == 0, 'newFamepayCampaign(): no incremental target for simple post');
            require(
                _potentialPayoutAmount >= _jackpotPayment,
                'newFamepayCampaign(): Amount deposited must be greater than reward'
            );
        }
        require(_deadline >= _startDate, 'newFamepayCampaign(): deadline must be after start date');
        require(_startDate >= block.timestamp, 'newFamepayCampaign(): campaign cannot be in the past');
        campaignPointer = campaignPointer + 1;
        uint256 campaignId = campaignPointer;
        Famepay famepay = new Famepay{value: msg.value}(
            _influencer,
            _business,
            _startDate,
            _deadline,
            _simplePostDuration,
            _jackpotPayment,
            _incrementalPayment,
            _jackpotTargetAmount,
            _incrementalTargetAmount,
            _objective,
            campaignId,
            accessControl
        );
        famepayCampaigns[campaignId] = address(famepay);
        emit NewFamepayCampaignCreated(
            _influencer,
            _business,
            address(famepay),
            campaignId,
            _startDate,
            _deadline,
            _simplePostDuration,
            _jackpotPayment,
            _incrementalPayment,
            _jackpotTargetAmount,
            _incrementalTargetAmount,
            _potentialPayoutAmount,
            _objective
        );
    }

    /**
     * @dev create new multi pot
     * @param _business participating business
     * @param _startDate start timestamp of bounty
     * @param _deadline completion timestamp of bounty
     * @param _simplePostDuration duration which post must be up
     * @param _maxJackpotReward max possible reward if jackpot objective achieved. Either fixed or variable!
     * @param _jackpotTargetAmount metric to achieve jackpot objective
     * @param _objective objective type
     * @param _bountyType fixed or variable pot
     * @param _maxWinners max winners allowed to claim pot
     */
    function newFamepayBounty(
        address payable _business,
        uint256 _startDate,
        uint256 _deadline,
        uint256 _simplePostDuration,
        uint256 _maxJackpotReward,
        uint256 _jackpotTargetAmount,
        uint256 _maxWinners,
        bytes4 _objective,
        bytes32 _bountyType
    ) external payable {
        require(_maxWinners > 0, 'newFamepayBounty(): at least one winner required');
        require(_deadline > _startDate, 'newFamepayBounty(): deadline must be after startDate');

        require(_startDate >= block.timestamp, 'newFamepayBounty(): campaign cannot be in the past');

        if (keccak256(abi.encodePacked(_objective)) == keccak256(abi.encodePacked('post'))) {
            require(_simplePostDuration >= 43200, 'newFamepayBounty(): post must be at least 12 hours');
        }

        uint256 potentialPayout = _maxWinners * _maxJackpotReward;
        require(msg.value >= potentialPayout, 'newFamepayBounty(): insufficient deposit amount');

        campaignPointer = campaignPointer + 1;

        FamepayBounty famepayBounty = new FamepayBounty{value: msg.value}(
            _business,
            _startDate,
            _deadline,
            _simplePostDuration,
            _maxJackpotReward,
            _jackpotTargetAmount,
            campaignPointer,
            _maxWinners,
            accessControl,
            _objective,
            _bountyType
        );
        famepayCampaigns[campaignPointer] = address(famepayBounty);
        emit NewMultiBountyCreated(
            _business,
            address(famepayBounty),
            _startDate,
            _deadline,
            _simplePostDuration,
            _maxJackpotReward,
            _jackpotTargetAmount,
            _maxWinners,
            campaignPointer,
            msg.value,
            _bountyType,
            _objective
            //potentialPayout -> calculate in subgraph
        );
    }

    function checkTimestamp() external view returns (uint256) {
        return block.timestamp;
    }

    function getCampaign(uint256 _campaignId) external view returns (address) {
        return famepayCampaigns[_campaignId];
    }
}

